    <Router>
      <div>
        <Navbar onnewClick={newuserHandler}/>
        <div>
          <Switch>
            <Route exact path="/">
              <Home />
            </Route>
            <Route path="/Chart">
              <Chart />
            </Route>
            <Route path="*">
              <NotFound />
            </Route>
          </Switch>
        </div>
      </div>
    </Router>
  );
}

export default App;

